  root: {
    flexGrow: 1,
  },
  navBar: {
    height: "50px",
    backgroundColor: "white",
    flexGrow: 1,
  },
  image: {
    flexGrow: 1,
  }

}));

const Header = (props) => {
  console.log(props.image)
  const classes = useStyles();
  return (
    <div className={classes.root}>
      <AppBar position="static">
        <Toolbar>
          <div className={classes.image}>
            <img src={Logo} className={classes.logo} />
          </div>

        </Toolbar>
      </AppBar>

    </div >
  )


}


export default Header;
